import React from 'react';
import './Analytics.css';

const Analytics = () => {
  return (
    <div className="analytics-page">
      <div className="page-header">
        <h1>Analytics</h1>
      </div>
      <div className="analytics-content">
        <p>Analytics dashboard coming soon...</p>
      </div>
    </div>
  );
};

export default Analytics;
